import "./App.css";

function App() {
  return (
    <div>
      <div
        style={{
          display: "flex",
          flexDirection: "row",
          justifyContent: "left",
          alignItems: "left",
        }}
      >
        <div>elementti1</div>
        <div>elementti2</div>
        <div>elementti3</div>
        <div
          style={{
            display: "flex",
