          style={{
            display: "flex",
            flexDirection: "colum",
            justifyContent: "right",
            alignItems: "left",
          }}
        >
          <div>elementti4</div>
          <div>elementti5</div>
          <div>elementti6</div>
        </div>
      </div>
    </div>
  );
}

